import '../App.css';
import './Aboutme.css';
import Button from "../Components/Button.js";
import {useSpring, useTransition, animated} from "react-spring";
import Footer from "../Components/Footer.js"
import AboutmeText from '../Components/AboutmeText';
import PeddyBerk from '../Components/Images/PeddyBerk';
import { transform } from 'async';


function Aboutme() {
  const slideIn = useSpring({
    config:{duration: 500, velocity: 80},
    from:{ transform: "translateY(-90px)",transform: "translateX(300px)"},
    tweenState:{ transform: "translateY(50px)", transform: "translateX(-50px)"},
    to:{ transform: "translateY(0)", transform: "translateX(0)"},
  })
  return (
    <div className="Aboutme">
      <div className="aboutme--top">
        <Button buttonStyle="home">Home</Button>
      </div>
      <animated.h1 style={slideIn} className="aboutme--header">About Me</animated.h1>
      <div className="parent--container">
        <PeddyBerk />
        <AboutmeText />
      </div>
      <animated.h1 style={slideIn}>Hiya!</animated.h1>
      <div className="footer--aboutme">
        <Footer />
      </div>
    </div>
  );
}

export default Aboutme;
